INSERT INTO `email_templates` (`id`, `created`, `modified`, `from`, `reply_to`, `name`, `description`, `subject`, `email_content`, `email_variables`) VALUES
(1, '2009-02-20 10:24:49', '2011-04-12 13:04:41', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Forgot Password', 'we will send this mail, when user submit the forgot password form.', 'Forgot password', 'Hi ##USERNAME##,\n\nA password reset request has been made for your user account at ##SITE_NAME##.\n\nIf you made this request, please click on the following link:\n\n##RESET_URL##\n\nIf you did not request this action and feel this is in error, please contact us.\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'USERNAME,RESET_URL,SITE_NAME'),
(2, '2009-02-20 10:15:57', '2011-04-12 13:05:04', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Activation Request', 'we will send this mail, when user registering an account he/she will get an activation request.', 'Please activate your ##SITE_NAME## account', 'Hi ##USERNAME##,\n\nYour account has been created. \nPlease visit the following URL to activate your account.\n##ACTIVATION_URL##\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'SITE_NAME,USERNAME,ACTIVATION_URL'),
(3, '2009-02-20 10:15:19', '2012-02-21 12:32:48', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'New User Join', 'we will send this mail to admin, when a new user registered in the site. For this you have to enable "admin mail after register" in the settings page.', 'New user joined in ##SITE_NAME## account', 'Hi, \n\nA new user named "##USERNAME##" has joined in ##SITE_NAME## account. \n\nUsername : ##USERNAME## \nEmail : ##EMAIL##\nSignup IP : ##SIGNUP_IP##\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'SITE_NAME,USERNAME'),
(4, '2009-03-02 00:00:00', '2011-04-12 13:05:29', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Admin User Add', 'we will send this mail to user, when a admin add a new user.', 'Welcome to ##SITE_NAME##', 'Hi ##USERNAME##,\n\n##SITE_NAME## team added you as a user in ##SITE_NAME##.\n\nYour account details.\n##LOGINLABEL##:##USEDTOLOGIN##\nPassword:##PASSWORD##\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'SITE_NAME,USERNAME,PASSWORD, LOGINLABEL, USEDTOLOGIN'),
(5, '2009-05-22 16:51:14', '2011-04-12 13:05:41', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Welcome Email', 'we will send this mail, when user register in this site and get activate.', 'Welcome to ##SITE_NAME##', 'Hi ##USERNAME##,\n\nWe wish to say a quick hello and thanks for registering at ##SITE_NAME##.\n\nIf you did not request this account and feel this is an error, please\ncontact us at ##CONTACT_MAIL##\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'SITE_NAME, USERNAME, SUPPORT_EMAIL'),
(6, '2009-05-11 19:24:45', '2011-04-12 13:06:00', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'New Comment Photo', 'we will send this mail, when a user get new comment on his photo.', '##USERNAME## wrote on your Photo...', '##USERNAME## wrote on your Photo:\n\n"##COMMENT##"\n\nTo see your Photo comment, follow the link below:\n##PHOTO_LINK##\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'USERNAME,COMMENT,PHOTO_LINK,SITE_NAME'),
(7, '2009-05-22 16:45:38', '2011-04-12 13:06:16', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Admin User Active ', 'We will send this mail to user, when user active   \r\nby administator.', 'Your ##SITE_NAME## account has been activated', 'Hi ##USERNAME##,\n\nYour account has been activated.\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'SITE_NAME,USERNAME'),
(8, '2009-05-22 16:48:38', '2011-04-12 13:06:30', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Admin User Deactivate', 'We will send this mail to user, when user deactive by administator.', 'Your ##SITE_NAME## account has been deactivated', 'Hi ##USERNAME##,\n\nYour ##SITE_NAME## account has been deactivated.\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'SITE_NAME,USERNAME'),
(9, '2009-05-22 16:50:25', '2011-04-12 13:06:42', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Admin User Delete', 'We will send this mail to user, when user delete by administrator.', 'Your ##SITE_NAME## account has been removed', 'Hi ##USERNAME##,\n\nYour ##SITE_NAME## account has been removed.\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'SITE_NAME,USERNAME'),
(10, '2009-07-07 15:47:09', '2011-04-12 13:06:53', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Admin Change Password', 'we will send this mail to user, when admin change user''s password.', 'Password changed', 'Hi ##USERNAME##,\n\nAdmin reset your password for your  ##SITE_NAME## account.\n\nYour new password: ##PASSWORD##\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'SITE_NAME,PASSWORD,USERNAME'),
(11, '2009-10-14 18:31:14', '2011-04-12 13:07:45', '##FIRST_NAME####LAST_NAME## <##FROM_EMAIL##>', '##FROM_EMAIL##', 'Contact Us ', 'We will send this mail to admin, when user submit any contact form.', '[##SITE_NAME##] ##SUBJECT##', '##MESSAGE##\n\n----------------------------------------------------\nTelephone    : ##TELEPHONE##\nIP           : ##IP##, ##SITE_ADDR##\nWhois        : http://whois.sc/##IP##\nURL          : ##FROM_URL##\n----------------------------------------------------\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'FROM_URL, IP, TELEPHONE, MESSAGE, SITE_NAME, SUBJECT, FROM_EMAIL, LAST_NAME, FIRST_NAME'),
(12, '2009-10-14 19:20:59', '2011-04-12 13:08:24', '"##SITE_NAME## (auto response)" ##NO_REPLY_EMAIL##', '', 'Contact Us Auto Reply', 'we will send this mail ti user, when user submit the contact us form.', '[##SITE_NAME##] RE: ##SUBJECT##', 'Dear ##FIRST_NAME####LAST_NAME##,\n\nThanks for contacting us. We''ll get back to you shortly.\n\nPlease do not reply to this automated response. If you have not contacted us and if you feel this is an error, please contact us through our site ##CONTACT_URL##\n\nThanks,\n##SITE_NAME##\n##SITE_URL##\n\n------ On ##POST_DATE## you wrote from ##IP## -----\n\n##MESSAGE##\n\nThanks,\n##SITE_NAME##\n##SITE_URL##', 'MESSAGE, POST_DATE, SITE_NAME, CONTACT_URL, FIRST_NAME, LAST_NAME, SUBJECT, SITE_URL'),
(17, '2011-12-29 00:00:00', '2011-12-29 00:00:00', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Review Comment', 'This notification mail will be sent to the owner of the reviewer, when someother users makes a comment for his review.', '##OTHER_USER## commented on your sighting of ##ITEM_NAME## @##PLACE_NAME##!', 'Hi ##USERNAME##,\r\n\r\n##OTHER_USER## left a comment on your sighting of ##ITEM_NAME## @\r\n##PLACE_NAME##\r\n\r\n##COMMENT##\r\n\r\nReply on ##SITE_NAME##!\r\n##REVIEW_LINK##\r\n\r\nThanks,\r\n##SITE_NAME##\r\n##SITE_URL##', 'USERNAME,MESSAGE,MESSAGE_LINK,SITE_NAME'),
(18, '2011-12-29 00:00:00', '2011-12-29 00:00:00', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Review Owner Comment', 'When review owner makes a comment for his review, a notification mail will be sent to all other users who has previously reviewed.', '##OTHER_USER## also commented on ##ITEM_NAME## @ ##PLACE_NAME##!', 'Hi ##USERNAME##,\r\n\r\n##OTHER_USER## also commented on ##ITEM_NAME## @ ##PLACE_NAME##\r\n\r\n##COMMENT##\r\n\r\nReply on ##SITE_NAME##!\r\n##REVIEW_LINK##\r\n\r\nThanks,\r\n##SITE_NAME##\r\n##SITE_URL##', 'USERNAME,MESSAGE,MESSAGE_LINK,SITE_NAME'),
(19, '2011-12-29 00:00:00', '2011-12-29 00:00:00', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'User Follow', 'This notification mail will be sent to the user when someone follows him.', '##OTHER_USER## started following you on ##SITE_NAME##!', 'Hi ##USERNAME##,\r\n\r\n##OTHER_USER## started following your sightings on ##SITE_NAME##.\r\n\r\nFollow ##OTHER_USER## back! ##FOLLOW_LINK##\r\n\r\nThanks,\r\n##SITE_NAME##\r\n##SITE_URL##', 'USERNAME,MESSAGE,MESSAGE_LINK,SITE_NAME'),
(20, '2011-12-29 00:00:00', '2011-12-29 00:00:00', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Review Rating', 'This notification mail will be sent to the user, when his review has been rated.', '##OTHER_USER## says "##RATING_TYPE##!"', 'About ##ITEM_NAME## @ ##PLACE_NAME##!\r\nCheck it out\r\n##REVIEW_LINK##\r\n\r\nThanks,\r\n##SITE_NAME##\r\n##SITE_URL##', 'USERNAME,MESSAGE,MESSAGE_LINK,SITE_NAME'),
(21, '0000-00-00 00:00:00', '2012-02-20 11:03:05', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Admin Approve Business', 'We will send this mail to user, when business request is approved   \r\nby administator.', 'Your ##SITE_NAME## business account has been activated', 'Hi ##USERNAME##,\n\nYour ##SITE_NAME## business account has been activated.\n\n\nThanks,\n ##SITE_NAME## - ##SITE_URL##', 'FROM_EMAIL,  USERNAME, ABOUT BUSINESS'),
(22, '0000-00-00 00:00:00', '2012-02-20 10:32:40', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Business Request', 'We will send this mail to admin, when user request for business.', 'Your ##SITE_NAME## user has requested for business', 'Hi Admin,\n\nUser has requested for business .\n\nThanks, \n##SITE_NAME## - ##SITE_URL##', 'FROM_EMAIL, REPLY_TO_EMAIL, SITE_URL, SITE_NAME, USERNAME,CONTACT_URL'),
(23, '2012-01-31 11:57:26', '2012-02-20 11:02:47', '##FROM_EMAIL##', '##REPLY_TO_EMAIL##', 'Place Claim Request', 'We will send this mail to admin, when user request the claim for the place.', 'Your ##SITE_NAME## user has requested for place', 'Hi Admin,\n\nUser has requested for place .\n\nThanks, \n##SITE_NAME## - ##SITE_URL##', 'FROM_EMAIL, REPLY_TO_EMAIL, SITE_URL, SITE_NAME, USERNAME,CONTACT_URL');
