INSERT INTO `setting_categories` (`id`, `created`, `modified`, `parent_id`, `name`, `description`) VALUES
(1, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'System', 'Manage site name, contact email, from email, reply to email.'),
(2, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'SEO', 'Manage content, meta data and other information relevant to browsers or search engines'),
(3, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'Developments', 'Manage Maintenance mode.'),
(4, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'Regional', 'Manage site date-time format, timezone and default language'),
(5, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'Account', 'Manage different type of login option such as Facebook, Twitter, Yahoo and Gmail'),
(6, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'Third Party API', 'Manage third party settings such as Facebook, Twitter for authentication. '),
(7, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'Images', 'Manage the Image dimensions (Width x Height).'),
(8, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'Auto Logout', ''),
(9, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'Site Information', 'Here you can modify site related settings such as site name.'),
(10, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 2, 'Metadata', 'Here you can set metadata settings such as meta keyword and description.'),
(11, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 2, 'SEO', 'Here you can set SEO settings such as inserting tracker code and robots.'),
(12, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 3, 'Server', 'Here you can change server settings such as enabling maintenance mode setting.'),
(13, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 4, 'Regional', 'Here you can change regional setting such as site language, default city, routing URL.'),
(14, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 4, 'Date and Time', 'Here you can modify date time settings such as timezone, date time format.'),
(16, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 5, 'Account Settings', 'Here you can modify account settings such as admin approval, email verification, and other site account settings.'),
(30, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'Emails', 'Here you can modify email related settings such as contact email, from email, reply-to email. \r\n'),
(19, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 6, 'Facebook', 'Facebook is used for login using its account details. \r\nFor doing above, our site must be configured with existing Facebook account.\r\n<a href="http://dev1products.dev.agriya.com/doku.php?id=facebook-setup"> http://dev1products.dev.agriya.com/doku.php?id=facebook-setup </a>'),
(20, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 6, 'Twitter', 'Twitter is used for login using its account details. \r\nFor doing above, our site must be configured with existing Twitter account.\r\n<a href="http://dev1products.dev.agriya.com/doku.php?id=twitter-setup"> http://dev1products.dev.agriya.com/doku.php?id=twitter-setup </a>'),
(33, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 5, 'Privacy', 'Here you can modify privacy settings such as allowing user language change, comments, profile page settings, permission override for user showing name, address, gender and other user personal settings.'),
(34, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 8, 'Logout', 'Manage logout options.'),
(31, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 5, 'Logins', 'Here you can modify user login settings such as enabling 3rd party logins and other login options.'),
(35, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'CDN', 'Manage CDN server settings which is used to store the Images, CSS and JavaScript. So all the above will be loaded from CDN server to your site.'),
(36, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 35, 'Configuration', ''),
(37, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'Mobile Apps', 'Manage iPhone App key.'),
(38, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 37, 'Configuration', 'All mobile apps will send secret key (hard coded in Mobile App) to fetch data from server. App''s key should be matched with this value.\r\nWarning: changing this value may break your mobile apps. '),
(39, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'Point System', 'Manage point system related settings'),
(40, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 39, '', ''),
(43, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 6, 'Google Translations', '<p>We use this service for quick translation to support new languages in ##TRANSLATIONADD##.</p> <p>Note that Google Translate API is now a <a href="http://code.google.com/apis/language/translate/v2/pricing.html" target="_blank">paid service</a>. Getting Api key, refer <a href="http://dev1products.dev.agriya.com/doku.php?id=google-translation-setup" target="_blank">http://dev1products.dev.agriya.com/doku.php?id=google-translation-setup</a>.</p>'),
(44, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'Suspicious Words', 'Here you can place various words, which accepts regular expressions also, to match with your terms and policies. '),
(45, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 6, 'Foursquare', 'Foursquare is used for login and posting message using its account details. \r\nFor doing above, our site must be configured with existing Foursquare account.\r\n<a href="http://dev1products.dev.agriya.com/doku.php?id=foursquare-setup"> http://dev1products.dev.agriya.com/doku.php?id=foursquare-setup </a>'),
(46, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 44, 'Suspicious Words Detector', 'Here you can update the Suspicious Words Detector related settings.'),
(47, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 6, 'Google Map', 'Here you can update Google Map credentials.'),
(48, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 4, 'Regional', 'Here you can change regional setting such as site language.'),
(49, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 5, 'Privacy', 'Here you can modify privacy settings such as allowing user language change. ');
